import * as React from "react";
import logo from "../Images/CSVValED.png";
import about from "../Images/exclamationPoint.svg";
import help from "../Images/questionMark.svg";
import './Heading.css';
import { Link } from "react-router-dom";

class Heading extends React.Component {
    render() {
        return (
            <h1 className="text-left" >
                <span className="badge bgWarning" id="help" role="button">
                    <Link to="/help">
                        <img src={help} alt="?" />
                        <i className="bi bi-question-diamond-fill"></i>
                    </Link>
                </span>

                <Link to="/">
                    <img src={logo} alt="CSVValEd" />
                </Link>

                <span className="badge bgPrimary" id="about" role="button">
                    <Link to="/">
                        {/* <img src={about} alt="!"/> */}
                        <i class="bi bi-exclamation-diamond-fill"></i>
                    </Link>
                </span>
            </h1>
        );
    }
}

export default Heading;
